import React from 'react'
import '../styles/sections/Brandregistrationform.css'

function Brandregistrationform() {
    return(
        <div className='brand-landingpage-container'>
                        <Link className='affiliate-landingpage-logo-link' to='/affiliate'>
                <img className='affiliate-landingpage-logo' src="https://www.firstx.ai/images/logo.svg" alt='Brandaffy logo' />
            </Link>
        </div>
    )
}

export default Brandregistrationform
